import FormInput from "./FormInput";
const Form = (props) => {
    const {onSubmit, onChange, inputs} = props;

    return (
        <form onSubmit={onSubmit}>
        <h1>Регистрация</h1>
        {inputs.map((input) => (
            <FormInput
                key={input.id}
                {...input}
                value={values[input.name]}
                onChange={onChange}
            />
        ))}
        <button>Зарегистрироваться</button>
    </form>);
};

export default Form;
